import React from 'react';
const video = require('./testVideo.mp4');

const HomePage = () => {

    return (
        // <div id="homeVideo">
        //     <iframe src="https://www.youtube.com/embed/6glb4tHdS44?autoplay=1" frameborder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>
        // </div>
        <div id="homeVideo">
            <video height='90%' width='auto' id='background-video' loop autoplay>
                <source src={video} type='video/mp4' />
            </video>
        </div>
        )
};

export default HomePage;
